        instructions:
            "<ol><li>To make the espresso bring water to a boil and then pour it over the espresso. Set aside to cool. When cooled add the melted ice cream</li><li>For the caramel-cream: Place 1 cup sugar and water in a 2 quart pot with a glass lid. Cover and bring to a boil over medium-high heat. Do not remove lid or stir the sugar mixture or it will begin to crystallize. The glass lid is a convenient way of watching the sugar so you know when it changes color as well as keeping the steam inside and preventing crystallization.</li><li>When the sugar begins to look caramelized watch it carefully and remove from heat when it reaches deep amber color. Be very careful as the sugar is extremely hot and also watch that it doesn't burn. It can go from amber to burnt very quickly.</li><li>Immediately off the heat pour the one cup cream into the caramel. The caramel will stiffen, sizzle and splatter so be careful. Return to a medium heat and cook until the caramel melts together with the cream.</li><li>Pour the caramel cream into the coffee and refrigerate until cold.</li><li>To assemble, fill a glass with ice, scoop two ice cream scoops into each glass.</li><li>Pour the iced espresso cream over and top with sweetened whipped cream (the other cup of cream whipped with 1 tablespoon sugar).</li><li>Garnish with caramel syrup and serve chilled.</li></ol>",
