        image: 'https://spoonacular.com/recipeImages/632790-556x370.jpg',
        imageType: 'jpg',
        summary:
            'You can never have too many condiment recipes, so give Arugula Walnut Pesto a try. This recipe serves 4. One portion of this dish contains about <b>2g of protein</b>, <b>9g of fat</b>, and a total of <b>86 calories</b>. For <b>44 cents per serving</b>, this recipe <b>covers 3%</b> of your daily requirements of vitamins and minerals. 28 people have made this recipe and would make it again. A mixture of arugula, garlic, walnuts, and a handful of other ingredients are all it takes to make this recipe so yummy. It is a good option if you\'re following a <b>gluten free and primal</b> diet. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 58%</b>, which is pretty good. Similar recipes are <a href="https://spoonacular.com/recipes/arugula-walnut-pesto-489854">Arugula Walnut Pesto</a>, <a href="https://spoonacular.com/recipes/arugula-walnut-pesto-8289">Arugula Walnut Pesto</a>, and <a href="https://spoonacular.com/recipes/arugula-and-walnut-pesto-476027">Arugulan and Walnut Pesto</a>.',
        cuisines: [],
        dishTypes: ['condiment', 'dip', 'sauce', 'spread'],
        diets: ['gluten free', 'primal'],
        occasions: [],
        instructions:
            'With this recipe you play with the amount of ingredients based on your likes & the strength of the garlic, arugula, etc.\nBest to use a mortar & pestle but if you dont have one the food processor works just fine.\nIn the mortal & pestle or the processor start off with your arugula and a drizzle of oil to get it working. Once pulverized add in 1 clove of garlic & continue to grind. Now add in your nuts, lemon juice and a bit of salt & pepper & give it one more grind. At this point abandon the mortal & pestle or the machine & dump the mixture into a bowl.\nAdd a small handful of cheese and while continuously mixing add in the olive oil until you achieve your desired consistency. For crostini I would leave as a paste, for a pasta sauce keep it a bit looser - this is all based on the amount of olive oil you use.\nNow recheck your seasonings - more garlic? A little light on the acid? Add a squeeze of lemon. Is it flat? A pinch of salt will wake it up. Let sit for an hour or so to let the flavors incorporate. Store in the fridge. It will last a few days before the arugula will turn.\nServe tossed over fresh pasta or rubbed over toasty bread with a ribbon of parmesan, a delicious topping for pizza or a beautiful frittata with a dollop of arugula pesto! There are a million ways to use this - enjoy!',
